import { List } from "antd";
import React from "react";
import styled from "styled-components";

export const FollowList = ({ header, data }) => {
  return (
    <ListWrapper
      header={<div>{header}</div>}
      grid={{ gutter: 4, xs: 2, md: 3 }}
    />
  );
};

const ListWrapper = styled(List)`
  margin-bottom: 20px;
`;
